import React, { Component } from 'react';

class About extends Component {
    constructor(props){
        super(props);
        this.state = {}
    }
    render(){
        return (
            <div>
               This is About Page,Test for Link{this.props.router.query.name}.
            </div>
        )
    }
}
export default About
